function constructProductMatrix(grid: number[][]): number[][] {
    const n = grid.length;
    const m = grid[0].length;
    let p: number[][] = new Array(n).fill(0).map(() => new Array(m).fill(1));
    const mod = 12345;

    // Helper function to calculate the product of all elements except the one at (excludeI, excludeJ)
    function productExceptSelf(excludeI: number, excludeJ: number): number {
        let product = 1;
        for (let i = 0; i < n; i++) {
            for (let j = 0; j < m; j++) {
                if (i !== excludeI || j !== excludeJ) { // Exclude the current element
                    product = (product * grid[i][j]) % mod;
                }
            }
        }
        return product;
    }

    // Construct the product matrix
    for (let i = 0; i < n; i++) {
        for (let j = 0; j < m; j++) {
            p[i][j] = productExceptSelf(i, j);
        }
    }

    return p;
}
